INSERT INTO `levels` VALUES (39,'Pass','You will have collected and displayed examples of:\r\nnavigation buttons\r\nnavigation bar\r\nadvertising banner\r\n\r\nfrom at least two different websites.\r\n\r\nYou will have reviewed each graphic and will have described the purpose\r\nand the positive and negative aspects.',1,38,4,NULL,'2011-06-01 10:21:01','2011-09-14 12:22:15',NULL,NULL,'Describe the suitability of the product\r\n\r\nGive details of the physical dimensions\r\n\r\nGive valid reasons when identifying the positive and negative aspects',NULL),(40,'G-F','You make a statement (P) Award one mark for each statement made. ',2,39,101,NULL,'2011-06-07 09:44:07','2013-11-18 20:43:52',1,4,'Give me evidence (e.g. facts from history) that backs up your points. ',40),(41,'E','Statement include descriptions (e.g. evidence that backs up their point), but no explanation of how the evidence backs up their point. (P,E)',3,39,101,NULL,'2011-06-07 09:44:21','2013-11-18 20:43:52',5,6,'Give me more evidence or more detailed evidence to back up your point. ',41),(42,'D','Statement include detailed descriptions (e.g. evidence that backs up their point), but no explanation of how the evidence backs up their point. (P,E)',4,39,101,NULL,'2011-06-07 09:44:35','2013-11-18 20:43:52',7,8,'Tell me why your evidence proves your point. ',42),(43,'C','Statements will be backed up with evidence and pupils will use evidence to help explain their answer to the question. (P,E,E) They have a balanced argument.',5,39,101,NULL,'2011-06-07 09:45:17','2013-11-18 20:43:52',9,10,'Tell me more reasons why your evidence proves your point and give more detail to your evidence. ',43),(44,'B','Statements will be backed up with lots of detailed evidence and pupils will use evidence to help explain their answer to the question in detail. (P,E,E) They have a balanced argument',6,39,101,NULL,'2011-06-07 09:45:25','2013-11-18 20:43:52',11,12,'Give lots of detailed facts to your answer. Choose the best evidence 