INSERT INTO `marks` VALUES (4,'You are showing a good understanding of the factors that affect Roman Public Health.\r\nYou need to make sure that you actually use historical events in your PEE\'d paragraphs  You are speaking generally and this is stopping you progressing further.',128,23,41,NULL,NULL,'2011-09-09 13:41:28','2012-10-14 13:19:21',6,0,'I39_41_6','',0,0,0,0,0,42),(5,'You mention germs alot in your answer. You must realise that the Romans were not aware of germs. They realised however, the link between dirt and illness, not germs and illness.',118,23,41,3,NULL,'2011-09-09 13:45:17','2012-10-14 13:19:21',5,0,'I39_41_5','',0,0,0,0,0,42),(6,'you are being too general with your answer. You must use real History to use in your evidence part of your PEE answer.',122,23,41,NULL,NULL,'2011-09-09 13:49:46','2012-10-14 13:19:21',5,0,'I39_41_5','',0,0,0,0,0,42),(7,'',127,23,42,3,NULL,'2011-09-09 13:59:43','2012-10-14 13:19:21',7,0,'I39_42_7','',0,0,0,0,0,43),(10,'you are not following the PEE process as you were shown in the lesson. Use the sentence starters from the board to help you structure your work. ',125,23,40,NULL,NULL,'2011-09-11 20:44:13','2012-10-14 13:19:21',3,0,'I39_40_3','',0,0,0,0,0,41),(12,'Good start! To improve you need to add more detail to each part of your PEE paragraphs. You have shown that you understand the PEE process and now you should add more structure to your answer looking at both sides with a conclusion.',123,23,43,NULL,NULL,'2011-09-11 20:49:52','2012-10-14 13:19:21',9,0,'I39_43_9','',0,0,0,0,0,44),(14,'You mention germs alot in your answer. You must realise that the Romans were not aware of germs. They realised however, the link between dirt and illness, not germs and illness. ',132,23,41,NULL,NULL,'2011-09-11 20:59:19','2012-10-14 13:19:21',5,0,'I39_41_5','',0,0,0,0,0,42),(15,'you have one good PEE paragraph here, where you focus on relevant examples. Always choose examples from the time period you are describing.',119,23,43,3,NULL,